def allReplace(st, fr, to):
    foo = []
    def replace(s, sofar):
        if s.startswith(fr) :
            foo.append(sofar+s.replace(fr, to,1))
        if s!="":
            replace(s[1:], sofar+s[0])
    replace(st, "")
    return foo
